import React from 'react'

const FinalizarCompra = () => {
    const productosElegidos = window.localStorage.getItem("productosElegidos");
    const productosElegidosParse = JSON.parse(productosElegidos);

    return (
        <div>
            {productosElegidosParse.map(product => 
            <div key={product.id} className="modal-contenedor">
            {/* <div>
                <img className="img-fluid img-carrito" id="imgProcesar" src={product.img1}/>
            </div> */}
            <table>
                <tbody>
                    <tr>
                        <td>{product.nombre}</td>
                        <td>precio por unidad${product.precio}</td>
                        <td>total elegidos{product.elegidos}</td>
                        <td>precio subtotal${product.precioSubTotal}</td>
                    </tr>
                </tbody>
            </table>
        </div>
            )}
        </div>
    )
}

export default FinalizarCompra
